svg.script:
   
	var myMapApp = new mapApp(false,undefined);//与tooltip相关
	var obc;//
	var ocls;
	window.onSVGLoad=initLater();
	function initLater() {
     //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
         window.setTimeout("init()",100);
    }
	function init() {
		  
	    /* 添加tooltip*/
        //tooltip styles
         var tooltipTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":130};
         var tooltipRectStyles = {"fill":"white","stroke":"dimgray"};
         myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,10,20,3);
         //add tooltip to element
		 myMapApp.addTooltip("legend",undefined,true,false,"target","name");
		 myMapApp.addTooltip("zta",undefined,true,false,"target","name");
		
	}

	function Closeleone(){
	    
		 document.getElementById('cir1').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir2').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir4').setAttribute("style", "visibility: hidden");
		 document.getElementById('cir5').setAttribute("style", "visibility: hidden");
		 svgDoc.getElementById("mapI1").setAttribute("class","fil31");
		 svgDoc.getElementById("mapI2").setAttribute("class","fil31");
		
		 svgDoc.getElementById("mapII1").setAttribute("class","fil41");
		 svgDoc.getElementById("mapII2").setAttribute("class","fil41");
		 svgDoc.getElementById("mapII3").setAttribute("class","fil41");
		 svgDoc.getElementById("mapII4").setAttribute("class","fil41");
		 svgDoc.getElementById("mapII5").setAttribute("class","fil41");
		 svgDoc.getElementById("mapII6").setAttribute("class","fil41");
		 svgDoc.getElementById("mapII7").setAttribute("class","fil41");
		 svgDoc.getElementById("mapII8").setAttribute("class","fil41");
		
		
		 svgDoc.getElementById("mapIV1").setAttribute("class","fil47");
		 svgDoc.getElementById("mapIV2").setAttribute("class","fil47");
		
		 svgDoc.getElementById("mapV1").setAttribute("class","fil35");
		 svgDoc.getElementById("mapV2").setAttribute("class","fil35");
		 svgDoc.getElementById("mapV3").setAttribute("class","fil35");
		 svgDoc.getElementById("mapV4").setAttribute("class","fil35");
		
	}
	function Closeletwo(n){
	     
		 document.getElementById("cir" + n).setAttribute("style", "visibility: visible");
		 if(n==1){
		 svgDoc.getElementById("mapI1").setAttribute("class","fil10");
		 svgDoc.getElementById("mapI2").setAttribute("class","fil11");}
		 else if (n==2){
		 svgDoc.getElementById("mapII1").setAttribute("class","fil8");
		 svgDoc.getElementById("mapII2").setAttribute("class","fil7");
		 svgDoc.getElementById("mapII3").setAttribute("class","fil23");
		 svgDoc.getElementById("mapII4").setAttribute("class","fil15");
		 svgDoc.getElementById("mapII5").setAttribute("class","fil21");
		 svgDoc.getElementById("mapII6").setAttribute("class","fil6");
		 svgDoc.getElementById("mapII7").setAttribute("class","fil20");
		 svgDoc.getElementById("mapII8").setAttribute("class","fil9");}
		
		 else if (n==4){
		 svgDoc.getElementById("mapIV1").setAttribute("class","fil12");
		 svgDoc.getElementById("mapIV2").setAttribute("class","fil13");}
		  else if (n==5){
		 svgDoc.getElementById("mapV1").setAttribute("class","fil16");
		 svgDoc.getElementById("mapV2").setAttribute("class","fil17");
		  svgDoc.getElementById("mapV3").setAttribute("class","fil19");
		   svgDoc.getElementById("mapV4").setAttribute("class","fil18");}
	}
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.id;
		 
         var objectMap = svgDoc.getElementById("map"+cls);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
   }
   function Recover(evt) {
         var object = evt.target;
		 var cls = object.id;
         var objectMap = svgDoc.getElementById("map"+cls);
		 objectMap.setAttribute("class",ocls);
	}
